var title_f26_59_27572="Volvulus in hiatal hernia";
var content_f26_59_27572=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F73205&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F73205&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Volvulus in hiatal hernia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 383px; height: 379px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Paraesophageal hernias are associated with abnormal laxity of structures normally preventing displacement of the stomach, the gastrosplenic and gastrocolic ligaments. As the hernia enlarges, the greater curvature of the stomach rolls up into the thorax. Because the stomach is fixed at the gastroesophageal junction, the herniated stomach tends to rotate around its longitudinal axis, resulting in an organoaxial volvulus (top panels); infrequently, rotation occurs around the transverse axis resulting in a mesenteroaxial volvulus (bottom panels).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Peridikis G, Hinder RA. Paraesophageal hiatal hernia. In: Hernia, Nyhus LM, Condon RE (Eds), JB Lippincott, Philadelphia 1995. p.544.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
