var title_f26_59_27577="Laparoscopic cystectomy a";
var content_f26_59_27577=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F61558%7EOBGYN%2F73354%7EOBGYN%2F52353&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F61558%7EOBGYN%2F73354%7EOBGYN%2F52353&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 483px\">",
"   <div class=\"ttl\">",
"    Laparoscopic ovarian cystectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 463px; height: 259px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The ovarian cortex is incised in the direction of the ovarian axis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of William J Mann, Jr, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 495px\">",
"   <div class=\"ttl\">",
"    Laparoscopic ovarian cystectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 475px; height: 345px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The cyst wall is grasped and blunt dissection used to separate the cyst wall from the ovarian cortex.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of William J Mann, Jr, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Laparoscopic ovarian cystectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 431px; height: 267px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (C) Alternatively, the cyst wall can be grasped and rotated to separate it from the ovarian cortex. (D) The cyst is removed and the ovary is left to heal by secondary intention.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of William J Mann, Jr, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
