var title_f26_59_27582="LH FSH lack in GnRH deficiency";
var content_f26_59_27582=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F56592&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F56592&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lack of gonadotropin secretion in GnRH deficiency",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 428px; height: 350px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Serum LH (blue) and FSH (red) concentrations determined at one minute intervals in two men with idopathic hypogonadotropic hypogonadism. Patient A (upper figure) had microphallus, testicular volumes of one mL each, anosmia, and no history of spontaneous puberty. LH and FSH concentrations in most of his serum samples were at or below assay detection limits. Patient B (lower figure) had a normal-sized phallus, testicular volumes of 20 mL each, an intact sense of smell, and a history of partial onset of puberty with subsequent regression of sexual function. Serum testosterone concentrations (in ng/dL) at six-hour intervals are indicated by the numbers at the top of each sampling period.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Spratt, DI, Carr, DB, Merriam, GR, et al, J Clin Endocrinol Metab 1987; 64:283.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
